var Calendar=function(){function class_1(){this.newDate=new Date;this.year=this.newDate.getFullYear();this.month=this.newDate.getMonth()+1;this.days=new Date(this.year,this.month,0).getDate();this.emptyDaysBeforeFirstDay=new Date(this.year,this.month-1).getDay();this.day=1;this.weeks=Math.floor((this.emptyDaysBeforeFirstDay+this.days)/7+1);this.emptyDaysAfterLastDay=7*this.weeks-this.emptyDaysBeforeFirstDay-this.days;this.calendarTemplate=[];this.space="                  ";this.finalTemplate="| ðŸ—“  |         Su       |         Mo       |         Tu       |         We       |         Tu       |         Fr       |         Sa       |\n| -- | ---------------- | ---------------- | ---------------- | ---------------- | ---------------- | ---------------- | ---------------- |\n"}class_1.prototype.addDay=function(index){this.calendarTemplate[index].push("["+this.day+"](#_"+this.year+"-"+this.month+"-"+this.day+")")};class_1.prototype.incDay=function(){if(this.day<=this.days)this.day++};class_1.prototype.setIntUnderTen=function(param){if(param<10)param="0"+param;return param};class_1.prototype.fill=function(){this.month=this.setIntUnderTen(this.month);for(var i=0;i<this.weeks;i++)this.calendarTemplate.push([]);for(var i=0;i<this.emptyDaysBeforeFirstDay;i++)this.calendarTemplate[0].push(this.space);for(var i=0;i<7-this.emptyDaysBeforeFirstDay;i++){this.day=this.setIntUnderTen(this.day);this.addDay(0);this.incDay()}for(var i=0;i<this.calendarTemplate.length;i++){this.calendarTemplate[i].unshift(" W"+(i+1)+" ");for(var j=0;j<7;j++){this.day=this.setIntUnderTen(this.day);if(i<=this.weeks-2&&this.day<=this.days)this.addDay(i+1);this.incDay()}}for(var h=0;h<this.emptyDaysAfterLastDay;h++)this.calendarTemplate[this.calendarTemplate.length-1].push(this.space);for(var i=0;i<this.weeks;i++)this.finalTemplate+="|"+this.calendarTemplate[i].join("|")+"|\n";return console.log("\n\n\n"+this.finalTemplate+"\n\n")};return class_1}();(new Calendar).fill();